function run(data) {
    const integerManager = data.project.getPreset('FieldTypeInteger').propertyManager
    const numericManager = data.project.getPreset('FieldTypeNumeric').propertyManager
    const ruleManager = data.project.getPreset('ValidationRule').propertyManager
    const nameSet = new Set()
    ruleManager.list.forEach(rule => {
        if (rule.tag === 'WWW') {
            nameSet.add(rule.name)
        }
    })

    const addField = function(field, name) {
        const found = field.ruleManager.find(name)
        if (found) {
            return found
        }
        const rule = field.ruleManager.make(name)
        field.ruleManager.add(rule)
        return rule
    }

    data.entity.fieldManager.list.forEach(field => {
        if (field.included === false) {
            return
        }
        if (field.isIncrement) {
            return
        }

        addField(field, 'required')

        if (field.type === 'boolean') {
            addField(field, 'boolean')
            return
        }
        if (integerManager.find(field.type)) {
            addField(field, 'integer')
            return
        }
        if (numericManager.find(field.type)) {
            addField(field, 'numeric')
            return
        }
        if (field.type === 'char' || field.type === 'string') {
            if (field.length) {
                const max = addField(field, 'max')
                max.value = field.length
            }
        }

        if (nameSet.has(field.name)) {
            addField(field, field.name)
        }
    })
}

