function run(data) {
    data.model = data.project.getLayer('Model')

    data.seedText = seed => {
        const list = ['$faker']
        if (seed.unique) {
            list.push('unique()')
        }

        if (seed.type === 'property') {
            list.push(seed.value)
            return list.join('->')
        }

        if (seed.type === 'method') {
            list.push(`${seed.value}(${seed.parameter})`)
            return list.join('->')
        }

        return seed.value
    }
}

function run(data) {
    data.fieldText = function(field) {
        const list = ['$table']

        if (field.length) {
            list.push(`${field.type}('${field.name}', ${field.length})`)
        } else {
            list.push(`${field.type}('${field.name}')`)
        }

        if (field.collation) {
            list.push(`collation(${field.collation})`)
        }

        if (field.comment) {
            list.push(`comment(${field.comment})`)
        }

        if (field.value) {
            list.push(`default(${field.value})`)
        }

        if (field.allowNull) {
            list.push('nullable()')
        }

        if (field.useCurrent) {
            list.push('useCurrent()')
        }

        if (field.unsigned) {
            list.push('unsigned()')
        }

        return list.join('->')
    }

    data.indexText = function(index) {
        const text = index.fieldManager.list.map(field => field.name).join("', '")
        return `$table->${index.type}(['${text}'])`
    }
}

function run(data) {
    const castManager = data.project.getPreset('CastPHP').propertyManager
    const typeManager = data.project.getPreset('FieldType').propertyManager
    data.phptype = field => {
        if (field.cast) {
            const found = castManager.find(field.cast)
            if (found) {
                return found.value
            }
        }

        if (['created_at', 'updated_at', 'deleted_at'].includes(field.name)) {
            return '\\Illuminate\\Support\\Carbon'
        }

        const found = typeManager.find(field.type)
        if (found) {
            return found.tag
        }

        return 'mixed'
    }

    data.ruleText = field => {
        if (field.ruleManager.list.length) {
            const list = field.ruleManager.list.map(rule => {
                return rule.value ? `${rule.name}:${rule.value}` : rule.name
            })
            return `['${list.join("', '")}']`
        }
        return '[]'
    }
}

